import Udio
import Udio.hcaptcha

captcha_token = Udio.hcaptcha.get_captcha()

final_song = Udio.generate_song_sequence(
    auth_token0 = "base64-",
    auth_token1 = "",
    captcha_token=captcha_token,
    num_extensions=2,
    custom_lyrics_short="welcome to ULTA, the place where you move from full-stack to be fully stuck meow",
    custom_lyrics_extend=["Lyrics for first extension", "Lyrics for second extension"],
    custom_lyrics_outro="Outro lyrics here",
    short_prompt="generate a voice-over of this text",
    extend_prompts=["this is extended prompt", "hello world"],
    outro_prompt="this is outro prompt"
)
print("aoenguigweiugnweign")
print(final_song)
